window.bookSummaryJSON = "<p><b>Three steamy alien abduction romance audiobooks in one boxset! If you love hot aliens, strong heroines and hilarious misunderstandings, listen to this collection today!</b></p> <p><b>These aliens have no idea how to abduct a human.</b></p> <p>Alien abductions aren't easy. Havel, Matar and Xil have failed too many times to count. Their only hope is enrolling in an abduction course at the prestigious Intergalactic University. To complete their course, these three sexy aliens need to abduct, probe, and tame a human female - and they’re graded on it.</p> <p>They think they've found their perfect human abductee, but Trish has no intentions of making it easy for them. Being probed by aliens wasn't on her to-do list, no matter how good-looking they are. But, they are persistent, and she soon finds herself wooed with chocolate, awful lingerie, and a space bunny pet. </p> <p>When one of their university professors turns into a murderous maniac, Trish needs to decide whether to play along and save her aliens. Together, they might stand a chance, but is she ready to become their mate?</p> <p><b>A laugh-out-loud sci-fi reverse harem with clueless aliens and the human woman they’re trying to seduce (and probe). Beware, these aliens have fangs and tails and are ready to put them to good use. If you want hunky aliens who will protect their mate at all cost, a sassy female who doesn't need protecting, a happy end, plus every single alien abduction trope imaginable, scroll up, and listen to this box set today. Beware, you may be abducted at any moment, so don't waste time.</b></p> <p><b>This collection contains:</b></p> <ul> <li><b><i>Alien Abduction for Beginners</i></b></li> <li><b><i>Alien Abduction for Professionals</i></b></li> <li><b><i>Alien Abduction for Experts</i></b></li> </ul>"; 
